import React from "react";
import { Grid } from "@material-ui/core";

import SpecifiedDomainRadarChart from "SpecifiedDomainRadarChart";
import CoffeCard from "components/Card/CofferCard";
import productList from "dbCompoent/ProductList";
const Content = () => {
  const getProductList = (object) => {
    const { title, price, description, avatarSrc, imgSrc } = object;
    return (
      <Grid item xs={12} sm={4}>
        <CoffeCard {...object} />
      </Grid>
    );
  };

  return (
    <Grid container spacing={4}>
      {productList.map((object) => getProductList(object))}
    </Grid>
  );
};

export default Content;
